import './Categories.css'
import { useState } from "react";
import CategoryDetail from './CategoryDetail';

const Categories = (props) => {
    const [cat] = useState([
        { name: "Catagory"  },
        { name: "Catagory"  },
        { name: "Catagory"  },
        { name: "Catagory"  },
        { name: "Catagory"  },
